description:
Recently sold: $390,000. Gorgeous vaulted 4 bedroom 3 bath walkout on private wooded .37 acre lot with pond view; 
Gourmet center island kitchen with granite countertops, custom back splash, stainless steel appliances and hardwood floors; 
Nice bright sunroom off kitchen; 
Big patio plus deck; 
3 car garage; 
Great backyard with new privacy/ chain link fence; 
New windows throughout and new patio door; 
New high efficiency furnace; 
New gas fireplace insert; 
New 8 zone sprinkler system;
New carriage style garage doors;
Newly painted exterior

Recently sold: $205,000. Brand new carpet; Freshly painted; Super clean; Move-in ready; Huge vaulted ceiling in living room with gas burning fireplace; Kitchen open to living/dining room; Upper-level master suite with walk-in closet and full bath; Main-level bedroom with 3/4 bath; Open loft area for home office; Attached, insulated 2 car garage.

Tenants are responsible for gas and electric; Association takes care of water, lawn, and snow removal. Non-refundable application fee of $45 per adult. Requirements:
1. Income: at least 3 times of rent (last year's W2 and most recent 2 pay stubs);
2. No eviction history;
3. Credit score is greater than 650;
4. No criminal history.
